import { Fragment } from 'react';
import { valuePi, valueSun } from '../constants';

function MainBody(){
  return(
    <Fragment>
      <h1>Space project</h1>
      <p className="mb-0">Current known value of Pi: {valuePi} </p>
      <p className="mb-0">Circumference of the sun: {valueSun}</p>
    </Fragment>
  )
}

export default MainBody;
